Objectives / Expected Outcomes:
The purpose of the BioSense Redesign project is to establish a new technical and programmatic environment for the BioSense Program. Activities include collection of new information on end-user requirements and comparison with other existing syndromic surveillance systems that could be adapted to produce standardized system requirements and program design concepts for revisions to the BioSense Program. This will include gathering end-user requirements through formal and informal communication, utilizing unstructured data to gather information on other syndromic surveillance systems and system needs, developing an Operational Plan, and reviewing/revising the existing Strategic Plan to reflect changes in the BioSense Program. It will also require establishing a TEP, which will provide input and advice on the development of the new BioSense Program. It will further require producing standardized system requirements for program design concepts and prototypes, which can be developed using open-source/open-access tools. Program design concepts and prototypes will be reviewed and evaluated internally and by an external group of end users. The final selected program design concept/ prototype will include specification, security requirements, proposed program development, testing and evaluation, and documentation. Management support will include the following:

- updating the existing BioSense Strategic Plan;
- assessing the risks inherent in this plan (already commenced, but assessment of the risks will be ongoing throughout the project);
- producing and actively maintaining a Risk Mitigation Plan for the BioSense Program;
- providing project support and administration.

The Task Based User Interface (TBUI) project is being funded by the Office of Medicare Hearings and Appeals (OMHA). It is a multi-year effort across multiple releases designed to improve the mechanism for which the Level 3 (ALJ) Appeals users will conduct their day to day work activities. The TBUI will be designed with the goal to improve task/workflow processing. The ultimate goal of TBUI is to make MAS easier to use and improve the functionality for the Level 3 OMHA users. 
.
The MAS TBUI project is split into two separately funded phases, Phase I and Phase II. The work tasks that shall be completed by the contractor for this Project TBUI Phase 2 are:

-          Complete a detailed design document for the TBUI project;
-          Upon obtaining approval of the detailed design document, the contractor shall successfully carry out the development of the project elements as designated in the priority setting sessions at the end of system requirements; 
-          Validate, Test and Install the TBUI project additions and changes for/to the MAS system;
-          Provide training materials and training for OMHA staff in use of the MAS system changes and additions; and, 
-          Place the TBUI project changes and additions into production.

The eCase File Project is being funded by the Office of Medicare Hearings and Appeals (OMHA) as a multi-year effort. The business purpose of the e-Case File effort is to increase efficiency of adjudication by allowing for Level 3 MAS users to process appeals using an electronic case file; significantly reducing the time necessary to request, send, track, organize, print, and store the paper case file.  A further purpose of the e-Case File effort is to increase the security of personally identifiable information by eliminating the risks of breach or loss inherent to the process of shipping physical case files.  The functional purpose is to add new functionality to MAS providing enhanced electronic case file capabilities that will reduce existing manual processes with flexibility and efficiency.

The MAS eCase File project is split into two separately funded phases.  The objective of Phase 2 is to complete System Requirements of sufficient detail to allow the system to be built successfully during Phase II.  In order to complete Phase 2, the Contractor shall complete the following work tasks:

-          Complete the end-to-end analysis and evaluation of the present appeals case file workflow and design of MAS to meet that workflow;
-          Determine if the current use and integration of the various COTS products used by MAS meet and comply with industry best practices and CMS standards to support the e-Case File functions;
-          Obtain OMHA and CMS concurrence on the design and tools found to be appropriate for the OMHA business case;
-          Complete a detailed design document for the e-Case File module;
-          Upon obtaining approval of the detailed design document, successfully carry out the development of the module; 
-          Validate, Test and Install the e-Case File module for the MAS system;
-          Provide training materials and training for OMHA ALJ staff in use of the e-Case File module; and, 
-          Place the e-Case File system into production.

This includes a Lab Assessment and the necessary activities to assess, plan for, and design the implementations for a LIMS for all 16 ORA laboratories including the coordination of activities with OIM and ORA. This also includes pilots of LIMS in four of the ORA laboratories at the Northeast Regional Laboratory (NRL), the Denver, Colorado (DEN) laboratory, the Pacific Regional Laboratory (PRL), and the Southeast Regional Laboratory.
The Lab Assessment includes reviews and analyses to produce a workable design for the ORA laboratories. This includes functionalities across and within all ORA labs; workflow processing analysis; review of requirements for the pilots; data center versus local hosting; validation of network design; security requirements; business process models ("To-Be" state), gap analysis; a preliminary LIMS design; expected baseline performances and recommended levels of capacity; and analysis of future LIMS-MARCS-RBIS Integration.
Lab Assessment outcomes include: Recommendations regarding network and firewall configurations; server architecture to support data, application, and web tiers; meeting security requirements, management approaches; and other outputs such as refined LIMS requirements, management plan; business process models; work flow process documentation; and, a preliminary design for LIMS.  
Lab Pilots 1-4: Provide a LIMS solution at each laboratory. This is focused on microbiology and will build on the Lab Assessment results. These pilots will allow ORA to prove out the recommendations adopted from the Lab Assessment and lay the groundwork for the expansion of LIMS to all of the 16 ORA labs. The LIMS solution will require configuration to accommodate possible different business processes and lab instruments particular to individual FDA laboratories and will require integration with other FDA systems.
Activities in the Pilots include:
Review proposed Pilot design; develop Pilot(s) to help prove technical concepts; 
Integrate the LIMS with commercial off-the-shelf (COTS) products with FDA enterprise systems to form a LIMS solution.
Initiating LIMS configuration;
Utilizing custom development;
Conducting system testing (functional testing, unit testing, system testing, integration testing, and user-acceptance testing);
Procuring software licenses
Providing LIMS Pilots with integration to lab instruments;
Deploying planning for the Pilots; 
Developing Pilot Documentation; and,
Implementing the Pilots.

